import { useNavigate } from "react-router-dom";

function PrescList() {
    const presc = [
        { name: "방문 환자 1", date: "2023-04-05"},
        { name: "방문 환자 2", date: "2023-04-06"},
        { name: "방문 환자 3", date: "2023-04-07"},
        { name: "방문 환자 4", date: "2023-05-08"}
    ];

    const navigate = useNavigate();
    const watchPresc = () => {
        navigate("prescription1")
    }

    return (
        <div className="presc">
            <h1 id="header">Prescription System</h1>
            <div className='prescList'>
                {presc.map((pre, index) => {
                    return (
                        <button variant="primary" size="lg" onclick={watchPresc}>
                           {pre.name} / {pre.date}
                        </button>
                    ); 
                })}
            </div>
        </div>
    );
}

export default PrescList;
